description:
When Sunny Leone's parents leave town for the weekend, Sunny plans the slumber party of the year including a sneaky visit from her boyfriend. Her plans go awry when the mysterious Uncle Bill suddenly shows up to keep an eye on the house. Sunny's slumber party features an all-star cast including: Sunny Leone, Jenna Haze, Monique Alexander, Alexis Texas, Kiara Diane and Alyssa Reese. The cast is also rounded out by non sex performances from Ron Jeremy, Joanna Angel, and Randy West.

